import React, { useState } from "react"; 

function Form({ options, quest }){
    const [isChecked, setIsChecked] = useState("") 

    return (
        <div>
            <form> {quest.text}
       {options.map(o => 
        <label>{o.text}
             <input>
                checked={isChecked == o.text}
             </input>
             </label>
         )} 
   </form></div>
    )
}

export default Form();
